def is_prime(n):
    if n < 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def generate_array():
    array = []
    n = 0
    num_odd = 0
    num_even = 0
    for i in range(101):
        if i % 2 == 0:
            num_even += 1
        else:
            num_odd += 1
        array.append(i)
        n += i
        if is_prime(n):
            if int(num_odd ** 0.5) ** 2 == num_odd:
                (a, b) = (0, 1)
                while b <= num_even:
                    if b == num_even:
                        return array
                    (a, b) = (b, a + b)
    return None

